class Solution:
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        def _findSubstring(l, r, s_len, words_len, length, s, req, ans):
            tmp = {}
            while r + words_len <= s_len:
                word = s[r:r+words_len]
                r += words_len
                if word not in req:
                    l = r
                    tmp.clear()
                else:
                    tmp[word] = tmp[word] + 1 if word in tmp else 1
                    while tmp[word] > req[word]:
                        tmp[s[l:l+words_len]] -= 1
                        l += words_len
                    if r - l == length:
                        ans.append(l)
        if not s or not words or not words[0]:
            return []
        ans = []
        s_len = len(s)
        words_len = len(words[0])
        length = len(words) * words_len
        req = {}
        for w in words:
            req[w] = req[w] + 1 if w in req else 1
        for i in range(min(words_len,s_len-length+1)):
            _findSubstring(i,i,s_len,words_len,length,s,req,ans)
        return ans

    def __init__(self, s, words):
        self.s = s
        self.words = words

    def getAns(self, s ,words):
        print(Solution.findSubstring(self,s,words))

